import React from "react";
import "./ProfileCard.css"; // Make sure ProfileCard.css is in the same directory

const ProfileCard = () => {
  return (
    <div className="profile-card">
      <img src="https://via.placeholder.com/80" alt="Profile" className="profile-pic" />
      <h3>james</h3>
      <p>james@james</p>
      <p>Patient</p>
      <button className="btn2">Logout</button>
    </div>
  );
};

export default ProfileCard;
